			"Bearer": "Bearer {{parameters.bearerToken.token}}",
			"Basic": "Basic {{base64(parameters.basicAuth.username + ':' + parameters.basicAuth.password)}}",
			"method": "{{get(split(parameters.action, ' '), 1)}}",
			"endpoint": "{{get(split(parameters.action, ' '), 2)}}"
		},
		"qs": {
			"{{...}}": "{{if(parameters.inputType == 'manual', toCollection(parameters.qs, 'key', 'value'), parameters.qs)}}"
		},
		"url": "https://{{temp.fullDomain}}/{{ifempty(parameters.endpoint, replaceURI(temp.endpoint, parameters.uriParameters))}}",
		"body": "{{parameters.body}}",
		"type": "{{if(parameters.contentType == 'application/json', 'json', 'text')}}",
		"method": "{{ifempty(temp.method, parameters.method)}}",
		"headers": {
			"authorization": "{{get(temp, ifempty(parameters.authMethodOverride, parameters.authMethod))}}",
			"Content-Type": "{{parameters.contentType}}",
			"{{parameters.apiKey.key}}": "{{parameters.apiKey.value}}",
			"{{...}}": "{{if(parameters.inputType == 'manual', toCollection(parameters.headers, 'key', 'value'), parameters.headers)}}"
		},
		"response": {
			"output": {
				"body": "{{body}}",
				"headers": "{{headers}}",
				"statusCode": "{{statusCode}}"
			},
			"error": {
				"message": "[{{statusCode}}] {{body.error || body.name || body.code || body)}}\n{{body.message}}",
				"404": {
					"message": "[404] {{body.error}}"
