function payloadDefinitionParser(definition){
	if (!Array.isArray(definition)) return definition;
	return definition.flatMap(p => {
		const parameter = {
			name: p["sh:name"],
			type: "any",
		};

		if (p["sh:minCount"] && p["sh:minCount"] > 0) parameter.required = true;
		if(!p["raml-shapes:range"]) return parameter;
		if (p["raml-shapes:range"]["sh:name"]) parameter.label = p["raml-shapes:range"]["sh:name"];
		if (p["raml-shapes:range"]["core:description"]) parameter.help = p["raml-shapes:range"]["core:description"];
		if (Array.isArray(p["raml-shapes:range"]["sh:datatype"])) {
			parameter.type = iml.resolvePrimitiveType(p["raml-shapes:range"]["sh:datatype"][0]);
			return parameter;
		}
		if (Array.isArray(p["raml-shapes:range"]["raml-shapes:anyOf"])) {
			parameter.type = "collection";
			return Object.assign(parameter, iml.resolveAnyOf(p["raml-shapes:range"]["raml-shapes:anyOf"]));
		}
		if (p["raml-shapes:range"]["raml-shapes:items"]) {
			parameter.type = "array";
			if (p["raml-shapes:range"]["raml-shapes:items"]["raml-shapes:anyOf"]) {
				return Object.assign(parameter, iml.resolveAnyOf(p["raml-shapes:range"]["raml-shapes:items"]["raml-shapes:anyOf"]));
			}
			if (Array.isArray(p["raml-shapes:range"]["raml-shapes:items"]["sh:datatype"])) {
				parameter.spec = {
					type: iml.resolvePrimitiveType(p["raml-shapes:range"]["raml-shapes:items"]["sh:datatype"][0])
				};
				return parameter;
			}
			return parameter;
		}
		if (Array.isArray(p["raml-shapes:range"]["sh:property"])) {
			parameter.type = "collection";
			parameter.spec = iml.payloadDefinitionParser(p["raml-shapes:range"]["sh:property"]);
			return parameter;
		}
		return parameter;
	});
}

