function getExchangeEndpointExpects(body, target) {
	if (!Array.isArray(body["@graph"])) return undefined;
	const [targetMethod, targetPath] = target.split(" ");
	if (!targetMethod || !targetPath) return undefined;

	// Helper functions
	const find = (value, key = "@id") => Object.assign({}, body["@graph"].find(item => item[key] === value));
    const resolve = (node) => {
        if (typeof node !== "object" || node === null) return node;
		if (Object.keys(node).length === 1 && node["@id"]) {
            if (/^#\d+/m.test(node["@id"])) return resolve(find(node["@id"]));
			return node["@id"].split("#")[1];
		}
		if (Array.isArray(node)) return node.map((item) => resolve(item));
		Object.entries(node).forEach(([key, value]) => {
			node[key] = resolve(value);
		});
		delete node["@id"];
		delete node["@type"];
		return node;
    };

	// Find the endpoint and specified operation definition and resolve it recursively
	const endpoint = find(targetPath, "apiContract:path");
	if (!endpoint || !Array.isArray(endpoint["apiContract:supportedOperation"])) return undefined;
	const operation = endpoint["apiContract:supportedOperation"]
		.map(op => find(op["@id"]))
		.find(operation => operation["apiContract:method"] === targetMethod.toLowerCase());
	if (!operation || !Array.isArray(operation["apiContract:expects"])) return undefined;
	const expects = operation["apiContract:expects"].map(parameter => resolve(parameter));

    const request = [];
    const securities = [];
    const uriParameters = [];
    const headers =  [];
    const queryParameters = [];
    const payloads = [];

	if (Array.isArray(endpoint["apiContract:parameter"])){
		uriParameters.push(...endpoint["apiContract:parameter"].map(p => iml.exchangeParameterParser(resolve(p))));
	}

	// Transform the definition to our parameters spec
    expects.forEach(expect => {
		if (Array.isArray(expect["apiContract:uriParameter"])) {
            uriParameters.push(...expect["apiContract:uriParameter"].map(p => iml.exchangeParameterParser(p)));
		}
		if (Array.isArray(expect["apiContract:header"])) {
            headers.push(...expect["apiContract:header"].map(p => iml.exchangeParameterParser(p)));
		}
		if (Array.isArray(expect["apiContract:parameter"])) {
            queryParameters.push(...expect["apiContract:parameter"].map(p => iml.exchangeParameterParser(p)));
		}
		if (Array.isArray(expect["apiContract:payload"]) && expect["apiContract:payload"].length > 0) {
			const p = expect["apiContract:payload"][0];
			const payload = {
				name: "body",
				type: "any",
				label: "Add Input Body",
                help: `The content must be in the format: \`${p["core:mediaType"]}\``
			};
            if (Array.isArray(p["raml-shapes:schema"]["sh:property"])) {
				payload.spec = iml.payloadDefinitionParser(p["raml-shapes:schema"]["sh:property"]);
				payload.type = "collection";
				delete payload.help;
            }
            payloads.push(payload);
			payloads.push({
				name: "contentType",
				type: "hidden",
				label: "Content Type",
				default: p["core:mediaType"]
			});
		}
	});

    if (securities.length > 0) {
        request.push(...securities);
    }
    if (uriParameters.length > 0) {
        request.push({
            name: "uriParameters",
            type: "collection",
            label: "Add URI Parameters",
            spec: uriParameters
        });
    }
    if (headers.length > 0) {
        request.push({
            name: "headers",
            type: "collection",
            label: "Add Input Headers",
            spec: headers
        });
    }
    if (queryParameters.length > 0) {
        request.push({
            name: "qs",
            type: "collection",
            label: "Add Input Parameters",
            spec: queryParameters
        });
    }
    if (payloads.length > 0) {
        request.push(...payloads);
    }

	return request;
}
